import React from 'react';
import './_MyClimate.scss';


export default function Simple() {
    return (
        <div className="wrapper">
            <div className="myclimate">
                <div className="myclimate-content">
                    <h4>Trying to be eco responsible</h4>
                    <p>If like us, you face inner conflict between your passion for travelling and your concerns for ecology, we recommand you to compensate your Co2 emissions with our partner myClimate.org</p>
                    <button className="myclimatebtn-blue"><a href="https://co2.myclimate.org/en/flight_calculators/new" target="blank">My Climate</a></button>
                </div>
                <div className="myclimate-img">
                    <img src="https://lh3.googleusercontent.com/proxy/_1LMol0LXGUj5dL80MKZIQdhOYwb8Avx2A7ZN0HSwY-SOK6txZ8voQznnYSV3IrYbw2AVYG9KvQfBWC0BGunpYmKjMO1O689ZzDyuICqLPcEkT-YRYfn5OBM6Mtd5KR-nyBQxmxUlIP6Nf99TgQaQYOC-FU2yLRKPr6Q9XwKgOySBpK9" width="450px" />
                </div>
            </div>
        </div>
    )
}
